import React from 'react'
import { createStore } from 'redux'
import reducer from '../../Controllers/Reducer/reducer'
import * as actions from '../../Controllers/Actions/Actions'


function Home(){
    const store = createStore(reducer, window.STATE_FROM_SERVER)
    store.subscribe(()=>{console.log(store.getState())})
    return(
        <div>
            <h1>{store.getState().setName}</h1>
        </div>
    )
}

export default Home
